MongoDB not using Index on simple find<p>I have a collection called &quot;EN&quot; and I created an index as follow:</p>
<pre><code>db.EN.createIndex( { &quot;Prod_id&quot;: 1 } );
</code></pre>
<p>When I run db.EN.getIndexes() I get this:</p>
<pre><code>[{   &quot;v&quot;: 2,   &quot;key&quot;: {
    &quot;_id&quot;: 1   },   &quot;name&quot;: &quot;_id_&quot; }, {   &quot;v&quot;: 2,   &quot;key&quot;: {
    &quot;Prod_id&quot;: 1   },   &quot;name&quot;: &quot;Prod_id_1&quot; }]
</code></pre>
<p>However, when I run the following query:</p>
<pre><code>    db.EN.find({'Icecat-interface.Product.@Prod_id':'ABCD'})
      .explain()
</code></pre>
<p>I get this:</p>
<pre><code>{   &quot;explainVersion&quot;: &quot;1&quot;,   &quot;queryPlanner&quot;: {
    &quot;namespace&quot;: &quot;Icecat.EN&quot;,
