          &quot;$eq&quot;: &quot;ABCD&quot;
        }
      },
      &quot;direction&quot;: &quot;forward&quot;
    },
    &quot;rejectedPlans&quot;: []   },   &quot;command&quot;: {
    &quot;find&quot;: &quot;EN&quot;,
    &quot;filter&quot;: {
      &quot;ICECAT-interface.Product.Prod_id&quot;: &quot;ABCD&quot;
    },
    &quot;batchSize&quot;: 1000,
    &quot;projection&quot;: {},
    &quot;$readPreference&quot;: {
      &quot;mode&quot;: &quot;primary&quot;
    },
    &quot;$db&quot;: &quot;Icecat&quot;   },   &quot;serverInfo&quot;: {

</code></pre>
<p>It's using COLLSCAN instead of the index, why is this happening?</p>
<p>MongoDB version is 5.0.9-8</p>
<p>Thanks</p>
<p><strong>EDIT</strong> (and solution)</p>
<p>It turns that the field name has &quot;@&quot; in front and the index was created without this character so was not picking it up at all.</p>
<p>Once I created a new index using the field name as it was supposed to be it worked OK.</p>
<p>It was interesting though to see how indexing works and best practices</p>

