Typescript Errors "Missing Properties, and is not assignable to parameter void<p>I am new to typescript and I'm trying to understand why I'm getting the following errors.</p>
<blockquote>
<p>Type 'FindCursor&lt;WithId&gt;' is missing the following properties from type 'Topping': name, priceCents</p>
</blockquote>
<p>and</p>
<blockquote>
<p>Argument of type 'Promise' is not assignable to parameter of type 'void'</p>
</blockquote>
<pre><code>public async getToppingsData(ID: String): Promise&lt;Topping&gt; {
    const data = await this.collection.find({ _id: ID });
    if (data === null || data === undefined) {
      throw new Error(`Could not find ${ID}`);
    }

    const toppingData: Topping = data;

    return toToppingObject(toppingData);
