Mongoose min number validation doesn't work while inserting data<p>Using Node, Express and Mongoose, I'm trying to insert data into MongoDB through a POST method. The fields I'm trying to insert has a phone field on which I'm trying to assign a validation that will check if it has minimum ten digits. Otherwise, it'll throw validation error message. While inserting the data, it is being saved even though the phone field has less than ten digits. Why is this happening? And how to solve it? Please be advised, it is happening in case of inserting a data to MongoDB.</p>
<p>Here's the Mongoose model:</p>
<pre><code>const mongoose = require('mongoose');
const validator = require('validator');

const schema = new mongoose.Schema({
    name: {
        type: String,
        required: true,
        minLength: [2, 'Name should contain at least two characters!'],
        trim: true
    },
    email: {
        type: String,
        required: true,
        trim: true,
        validate(value) {
            if (!validator.isEmail(value))
                throw new Error('Invalid email!');
        }
    },
    phone: {
        type: Number,
        required: true,
        min: [10, 'Phone number should contain at least ten digits!'],
        trim: true
    },
    message: {
        type: String,
        required: true,
        minLength: [3, 'Message should contain at least three characters!'],
        trim: true
    },
    date: {
        type: Date,
        required: true,
        default: Date.now
    }
});

const RdwMessage = new mongoose.model('RdwMessage', schema);
module.exports = RdwMessage;
</code></pre>
<p>Here's the route to insert the data through POST:</p>
<pre><code>app.post('/contact', async (req, res) =&gt; {
    try {
        const doc = new RdwMessage(req.body);
        await doc.save();
        res.status(201).render('index');
    } catch (error) {
        res.status(404).send(`Failed to submit message with the following error: ${error}`);
    }
});
</code></pre>

